import { Component } from "react";
import React from "react";
import { Helpers, SimpleGrid } from "core";
import Constants from '../../utils/constants';
import { Backward, GetUrl, HandleError } from "../../utils/generals";

export default class StrListPage extends Component
{
    constructor(props)
    {
        super(props);
        this.state = {};

        this.notificationSystem = React.createRef();

        this.requestId = this.props.match.params.requestId;
    }   

    // Events.
    render()
    {
        return (
            <>
                <div className="card">
                    <div className="card-body">
                        <SimpleGrid context={ this } minHeightTableWrapper={ Constants.MinGridHeight } hasSearchBox hideExportButton
                            filterBgColor="primary" name="crdrqstList" title="STR جستجو شده" notificationSystem={ this.notificationSystem } enableAutoFetch
                            listApiUrl="/api/amls/Request/SearchRequests"
                            headers={[
                                        { title: "کد پرسنل", name: "personCode" },
                                        { title: "نام پرسنل", name: "personName" },
                                        { title: "تاریخ درخواست", name: "requestDateStr" },
                                        { title: "نوع درخواست", name: "requestTypeName" },
                                        { title: "وضعیت", name: "statusName" },
                                        { title: "کد خطا", name: "errorTrackingCode" },
                                ]} />
                    </div>
                    <div className="card-footer">
                        <div className="d-flex">
                            <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => Backward(e) } href="/" title="بازگشت به صفحه قبل">
                                بازگشت
                            <i className="ti ti-arrow-left ms-1"></i>
                            </a>
                        </div>
                    </div>
                </div>
            </>
        );
    }
}
